settings.cardCss:
@import url('https://fonts.googleapis.com/css2?family=Orbitron:wght@500&display=swap'); /* Clean futuristic font */

body {
    font-family: 'Orbitron', sans-serif;
    background-color: #0d0f1a; /* Dark background for contrast */
    display: flex;
    justify-content: center;
    align-items: center;
    height: 550px;
    margin: 0;
}

.card {
    background-color: #1e293b; /* Simplified dark card background */
    color: #ffffff;
    width: 725px;
    height: 530px;
    padding: 50px;
    border-radius: 16px; /* Slightly more rounded corners for a modern look */
    box-shadow: 0 15px 30px rgba(0, 0, 0, 0.3); /* Stronger shadow for depth */
    text-align: center;
    position: relative;
}

.relay-title {
    font-size: 28px;
    font-weight: 700;
    color: #fbc02d; /* Electric yellow for emphasis */
    margin-bottom: 30px;
}

.serial-number, .manufacturer-name {
    margin: 0;
    padding: 12px 0;
}

.serial-number {
    font-size: 20px;
    color: #9ea7b3; /* Soft silver color */
}

.manufacturer-name {
    font-size: 26px;
    color: #fbc02d; /* Electric yellow for emphasis */
    font-weight: 600;
}

